CREATE DATABASE produto_organico_br;
USE produto_organico_br;

-- Tabela produtor
CREATE TABLE produtor (
	id INT PRIMARY KEY,
    situacao_cnpj VARCHAR(100) NOT NULL,
    cnpj_cnpf VARCHAR(100) NOT NULL,
    nome VARCHAR(100) NOT NULL,
    escopo VARCHAR(100) NOT NULL,
    atividades VARCHAR(100),
    contato VARCHAR(100)
);

-- Tabela Localidade
CREATE TABLE localidade (
    id INT PRIMARY KEY,
    pais VARCHAR(100),
    uf VARCHAR(10),
    cidade VARCHAR(100) NOT NULL
);

-- Tabela Entidade (conectada a Produtor e Localidade)
CREATE TABLE entidade (
    id INT PRIMARY KEY,
    tipo VARCHAR(100),
	nome VARCHAR(100),
    id_cnpj INT,          -- FK para conectar com Produtor
    id_localidade INT,        -- FK para conectar com Localidade
    FOREIGN KEY (id_cnpj) REFERENCES produtor(id),
    FOREIGN KEY (id_localidade) REFERENCES localidade(id)
);

/*
-- Query: select * from produtor
LIMIT 0, 1000

-- Date: 2024-11-05 21:35
*/

/*
-- Query: select * from `localidade`
LIMIT 0, 1000

-- Date: 2024-11-05 21:32
*/


SELECT 
    e.id AS entidade_id,
    e.nome AS entidade_nome,
    p.nome AS nome_produtor,
    p.situacao_cnpj AS situacao_produtor,
    p.escopo AS escopo_produtor,
    l.pais AS pais_localidade
FROM 
    entidade e
JOIN 
    produtor p ON e.id_cnpj = p.id
JOIN 
    localidade l ON e.id_localidade = l.id
WHERE 
    l.pais = 'Brasil'
    AND p.situacao_cnpj = 'Ativo'
ORDER BY 
    e.nome;